window.bookSummaryJSON = "<p>Binge the Complete Series!</p> <p>I was burned at the stake at fourteen...</p> <p>I was drowned in a lake when I was twenty-four...</p> <p>At twenty-seven, I was stoned in a public square...</p> <p>I have died a hundred times in a hundred different ways, usually at the hands of the humans I've tried to save. But when a pregnant young woman finds her way into my tattoo shop with a demon on her tail, things go from bad to worse. Being a centuries-old witch isn't going to help me—nothing will.</p> <p>This time I might just die in a way that sticks... Permanently.</p> <p>If you enjoy foul-mouthed heroines, dark humor, and enemies-to-lovers, then check out Woman of Blood &amp; Bone, the first book in the action-packed Rogue Ethereal series.</p> <p>For an introduction to the Ethereal world, listen to the steamy Phoenix Rising series.</p>"; 
